import {
	Box,
	FormControl,
	FormLabel,
	Input,
	FormHelperText,
	FormErrorMessage,
	VStack,
} from "@chakra-ui/react";
import { useState } from "react";

function LoginPage() {
	return (
		<Box margin="20">
			<FormControl>
				<VStack spacing="5">
					<Box width="50%">
						<FormLabel>User ID</FormLabel>
						<Input />
					</Box>

					<Box width="50%">
						<FormLabel>Password</FormLabel>
						<Input />
					</Box>
				</VStack>
			</FormControl>
		</Box>
	);
}

export default LoginPage;
